import React from 'react';
import handleClick from "../Exercises"

function FlatbenchRow() {

    return (        
        <>
            <li><span onClick={handleClick} className="plus"><i class="fa fa-plus"></i></span>Flat Bench</li>     
        </>
    )
}

export default FlatbenchRow;
